                "$primary: #FDBE33;\n$secondary: #030F27;\n$tertiary: #EFE1C8;\n$success: rgb(32, 197, 32);\n\n//TEXT COLORS\n.txt_white{\n    color: white;\n}\n\n//THEMES\n.primary_theme{\n    background-color: $primary;\n    color: $secondary;\n}\n\n.secondary_theme{\n    background-color: $secondary;\n    color: $primary;\n}\n\n.error_theme{\n    background-color: rgb(255, 49, 49);\n    color: white\n}\n\n.success_theme{\n    background-color: $success;\n    color: white;\n}\n\n.txt_primary{\n    color: $primary;\n}\n\n.txt_secondary{\n    color: $secondary;\n}\n\n//background\n.bg_primary{\n    background-color: $primary;\n}\n\n.bg_secondary{\n    background-color: $secondary;\n}",
                '@use "colors";\n\n#landing_navbar{\n    background-color: colors.$primary;\n    padding: 2rem 3rem 0 3rem;\n    #top_logo_name{\n        display: flex;\n        gap: 1rem;\n    }\n\n    #bottom_nav{\n        background-color: colors.$secondary;\n        ul{\n            padding-left: 0;\n            display: flex;\n            li{\n                list-style: none;\n                display: flex;\n                a{\n                    text-decoration: none;\n                    color: white;\n                    font-weight: 500;\n                    padding: 1.5rem 1.5rem;\n                }\n            }\n        }\n    }\n\n    #logo{\n        object-fit: contain;\n    }\n}\n\n.bottom_options_nav{\n    width: 300px;\n    position: fixed;\n    bottom: 0;\n    right: 0;\n    background-color: colors.$secondary;\n    padding: 0.5rem 1rem;\n    border-top-left-radius: 0.25rem;\n    .bottom_nav_container{\n        .project_general_config_menu{\n            position: absolute;\n            bottom: 40px;\n            width: 100%;\n            background-color: colors.$secondary;\n            color: colors.$primary;\n            border-radius: 0.25rem;\n            transition: 0.3s ease;\n            .config_field{\n                display: flex;\n                align-items: center;\n                gap: 12px;\n                padding: 0.75rem 1rem;\n\n                input{\n                    width: 100%;\n                }\n            }\n            &.hide{\n                bottom: -500px;\n                transition: 0.6s ease;\n            }\n        }\n        position: relative;\n        ul{\n            padding-left: 0;\n            display: flex;\n            gap: 12px;\n            li{\n                .bottom_nav_icon{\n                    display: flex;\n                    align-items: center; \n                    cursor: pointer;\n                }\n                list-style: none;\n                color: colors.$primary\n            }\n        }\n    }\n    \n}\n\n\n\n\n\n.activity_selector_nav{\n    display: flex;\n    gap: 12px;\n    margin-bottom: 1rem;\n    select{\n        width: 100%;\n        padding: 0.5rem;\n    }\n}',
                "#landing_nav_title {\n    font-weight: 800;\n    font-size: 48px;\n    line-height: 72px;\n    letter-spacing: -1.5px;\n}\n\nh4{\n    font-family: 'Poppins';\nfont-style: normal;\n    font-weight: 500;\n    font-size: 43px;\n    line-height: 64px;\n    text-align: center;\n    letter-spacing: -1.5px;\n}\n\nh5{\n    font-family: 'Poppins';\n    font-style: normal;\n    font-weight: 500;\n    font-size: 30px;\n    line-height: 45px;\n}\n\nh6{\n    font-family: 'Poppins';\nfont-style: normal;\nfont-weight: 600;\nfont-size: 32px;\nline-height: 48px;\n/* identical to box height */\n\nletter-spacing: -1.5px;\n}\n\np{\n    font-family: 'Poppins';\nfont-style: normal;\nfont-weight: 500;\nfont-size: 24px;\nline-height: 36px;\ntext-align: center;\nletter-spacing: -1.5px;\n}\n\n.caption{\n    font-family: 'Poppins';\nfont-style: normal;\nfont-weight: 400;\nfont-size: 15px;\nline-height: 22px;\n/* identical to box height */\n\nletter-spacing: 0.4px;\n}\n\n.label{\n    font-family: 'Poppins';\nfont-style: normal;\nfont-weight: 400;\nfont-size: 12px;\nline-height: 18px;\n/* identical to box height */\n\nletter-spacing: 0.4px;\n}\n\n.body_1{\n    font-family: 'Poppins';\nfont-style: normal;\nfont-weight: 400;\nfont-size: 20px;\nline-height: 30px;\nletter-spacing: 0.5px;\n}\n\n.txt_left{\n    text-align: left;\n}\n\n.subtile_2{\n    font-family: 'Roboto';\nfont-style: normal;\nfont-weight: 500;\nfont-size: 14px;\nline-height: 16px;\nletter-spacing: 0.1px;\n}\n.showroom_stars_title{\n    font-family: 'Poppins';\n    font-style: normal;\n    font-weight: 600;\n    font-size: 15px;\n    line-height: 22px;\n    letter-spacing: 0.4px;\n}\n.showroom_stars_content{\nfont-family: 'Poppins';\nfont-style: normal;\nfont-weight: 400;\nfont-size: 11px;\nline-height: 16px;\nletter-spacing: 1.5px;\n}\n\n.button{\n    font-family: 'Poppins';\nfont-style: normal;\nfont-weight: 500;\nfont-size: 18px;\nline-height: 27px;\nletter-spacing: 1.25px;\n}\n\n.txt_center{\n    text-align: center;\n}\n\n.txt_800{\n    font-weight: 800;\n}",
                ".flex{\n    display: flex;\n}\n\n.flex_sm_colum{\n    flex-direction: column;\n}",
                ".btn{\n    border: none;\n    padding: 0.75rem 1rem;\n    cursor: pointer;\n}",
                "\n\n.grid{\n    display: grid;\n}\n\n.col_3 {\n    grid-template-columns: repeat(3, 1fr);\n}\n\n.col_6{\n    grid-template-columns: repeat(6, 1fr);\n}\n\n.col_sm_2{\n    grid-template-columns: repeat(2, 1fr);\n}\n\n.span_sm_2{\n    grid-column: span 2;\n}\n\n\n///Create columns for the grid\n@mixin grid_mixin($count, $screenSize) {\n    @for $i from 1 through $count{\n        .col_#{$screenSize}_#{$i} { \n            grid-template-columns: repeat(#{$i}, 1fr);\n         }\n    }\n}\n\n///Create spans for the grid\n@mixin grid_span_mixin($count, $screenSize) {\n    @for $i from 1 through $count{\n        .span_#{$screenSize}_#{$i} { \n            grid-column: span #{$i};\n         }\n    }\n}\n\n///Create gaps for the grid\n@mixin grid_gap_mixin($count, $screenSize, ) {\n    @for $i from 1 through $count{\n        .gap_#{$screenSize}_#{$i*4} { \n            gap: #{$i * 0.25rem};\n         }\n    }\n}\n\n\n//this is xsm - extra small\n@media (min-width: 599px) {\n    @include grid_mixin(12, xsm);\n    @include grid_span_mixin(12, xsm);\n    @include grid_gap_mixin(12, xsm);\n\n    .justify_content_xsm_center{\n        justify-content: center;\n    }\n\n    .alig_items_xsm_center{\n        align-items: center;\n    }\n}\n\n//this is sm - small\n@media (min-width: 904px) {\n    @include grid_mixin(12, sm);\n    @include grid_span_mixin(12, sm);\n    @include grid_gap_mixin(12, sm);\n\n    .justify_content_sm_center{\n        justify-content: center;\n    }\n\n    .alig_items_sm_center{\n        align-items: center;\n    }\n}\n\n//this is md - medium\n@media (min-width: 1239px) {\n    @include grid_mixin(12, md);\n    @include grid_span_mixin(12, md);\n    @include grid_gap_mixin(12, md);\n\n    .justify_content_md_center{\n        justify-content: center;\n    }\n\n    .alig_items_md_center{\n        align-items: center;\n    }\n}\n\n//this is large\n@media (min-width: 1440px) {\n    @include grid_mixin(12, lg);\n    @include grid_span_mixin(12, lg);\n    @include grid_gap_mixin(12, lg);\n\n    .justify_content_lg_center{\n        justify-content: center;\n    }\n\n    .alig_items_lg_center{\n        align-items: center;\n    }\n}",
